import ReactDOM from "react-dom";
import React, { useState } from "react";

import Jumbotron from "react-bootstrap/Jumbotron";
import Toast from "react-bootstrap/Toast";
import Container from "react-bootstrap/Container";
import Private from "./Private";
import Public from "./Public";
import Navbar from "./Navbar";
import MainContent from "./MainContent";

import { Button, Form, FormControl, Card, Carousel } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

export default class Welcome extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      index: 0,
      setIndex: 0,
      direction: null,
      setDirection: null
    };
  }

  async conponentDidMount() {}
  conponentDidUpdate() {}
  conponentWillUnmount() {}

  ExampleToast = ({ children }) => {
    const [show, toggleShow] = useState(true);
    return (
      <>
        {!show && <Button onClick={() => toggleShow(true)}>Show Toast</Button>}
        <Toast show={show} onClose={() => toggleShow(false)}>
          <Toast.Header>
            <strong className="mr-auto">React-Bootstrap</strong>
          </Toast.Header>
          <Toast.Body>{children}</Toast.Body>
        </Toast>
      </>
    );
  };

  render() {
    return (
      <Container className="p-3">
        <Navbar />
        <MainContent />

        <Public />
        <Container>
          <div class="private">
            <h2 class="page-section-heading text-center text-uppercase mb-0">
              Private Projects
            </h2>
            <p>
              Hello..... Its me..... This is Home and there will be a round icon
              that is me
            </p>
            <Private />
          </div>
        </Container>
        <Container>
          <div class="contact">
            <h2 class="page-section-heading text-center text-uppercase mb-0">
              Contant
            </h2>
            <p>
              Hello..... Its me..... This is Home and there will be a round icon
              that is me
            </p>
          </div>
        </Container>

        <ExampleToast className="toast">
          We now have Toasts
          <span role="img" aria-label="tada">
            ������
          </span>
        </ExampleToast>
      </Container>
    );
  }
}

const ExampleToast = ({ children }) => {
  const [show, toggleShow] = useState(true);

  return (
    <>
      {!show && <Button onClick={() => toggleShow(true)}>Show Toast</Button>}
      <Toast show={show} onClose={() => toggleShow(false)}>
        <Toast.Header>
          <strong className="mr-auto">React-Bootstrap</strong>
        </Toast.Header>
        <Toast.Body>{children}</Toast.Body>
      </Toast>
    </>
  );
};
